      //   return value.map((usp, index) => (
      //     <Col span={8} key={index}>
      //       <UspCard data={[usp, index]} />
      //     </Col>
      //   ));

      // case "List":
      //   // No need for `await` if `value` is not a Promise
      //   return (
      //     <div style={{ width: "220px" }}>
      //       <Row
      //         style={{
      //           display: "flex",
      //           justifyContent: "start",
      //           alignItems: "start",
      //           width: "220px",
      //           fontSize: "12px",
      //         }}
      //       >
      //         {value.map((row, index) => (
      //           <>
      //             <Row style={{ width: "20px", marginTop: "3px" }}>
      //               <CheckCircleOutlined style={{ color: "green" }} />
      //             </Row>
      //             <Row style={{ width: "200px" }}>
      //               <span style={{ color: "GrayText" }}>{row}</span>
      //             </Row>
      //           </>
      //         ))}
      //       </Row>
      //     </div>
      //   );

      default:
        return <div>Unknown status.</div>; // Fallback for unknown types
    }
  };

  return (
    <div className="product-view">
      <div className="course-container">
        <div className="course-content">
          <div className="course-info">
            <Card
              title={
                <div>
                  <Row>
                    <Avatar
                      src="https://i.pinimg.com/564x/b9/90/b9/b990b9b5ea80ef423092bbe9bfd822ef.jpg"
                      size={100}
                      style={{
                        marginRight: "10%",
                      }}
                    />
                    <Col>
                      <Col style={{ fontSize: "15px" }}>
                        Devops training certification
                      </Col>
                      <Col style={{ color: "#989a9c" }}>
                        Master DevOps Engineer Course Online
                      </Col>
                    </Col>
                  </Row>
                </div>
              }
              style={{
                width: "94%",
                boxShadow:
                  "rgba(17, 17, 26, 0.1) 0px 8px 24px, rgba(17, 17, 26, 0.1) 0px 16px 56px, rgba(17, 17, 26, 0.1) 0px 24px 80px",
                height: "20%",
                display: "flex",
              }}
            >
              <img
                alt="example"
                src="https://i.pinimg.com/736x/b6/ca/9a/b6ca9aa53cf9b7d19d28c28f9f2fca06.jpg"
                style={{ height: "250px", width: "350px" }}
              />
              <CircleClip />
            </Card>
            <div>
              {content.map((data, index) => (
                <div className="course-content" key={index}>
                  <div className="info-key">{data?.key}</div>
                  <div className="info-value">
                    {getContent(data?.display_type, data?.value)}
                  </div>
                </div>
              ))}
            </div>

            {/* <div className="info-key">Course Includes</div>
            <div className="info-value">
              {StampData.map((data) => (
